/**
 * Handles page's onAttach event.
 */
function onPageAttach() {
  app.pages.Sheet.properties.Url = 'https://docs.google.com/spreadsheets/d/1UMz4wuoneU_7ynfbQs_GLIuGkctK4baIj_QcnX7SvEg/edit?usp=sharing&amp;single=true&amp;widget=true&amp;headers=false';
}


/**
 * Generates IFrame HTML text to embed a webpage.
 * @param {string} url - URL of webpage to embed.
 * @return {string} HTML text of IFrame.
 */
function getIframeHtml(url) {
  return '<div class="wrapper full-size"><iframe src="' +
    app.sanitizer.sanitizeUrl(url || '') +
    '" frameborder="0" class="full-size"></iframe></div>';
}


